def generate_random_string(N):
    return ''.join(random.choices(string.ascii_uppercase + string.digits, k=N))

def naive_implementation():
    res = ""
    cur_num = 0
    for i in range(math.floor(len(data) / 8)):
        temp = data[cur_num: cur_num + 8]
        cur_num += 8
        res = res + temp[6:8] + temp[4:6] + temp[2:4] + temp[0:2]
    return res


class myThread(threading.Thread):


    def __init__(self, threadID, name, data ,threads_list ):
        threading.Thread.__init__(self)
        self.threadID = threadID
        self.name = name
        self.data = data
        self.threads_list = threads_list
        # print("Thread id {} prints: \n {}".format(self.threadID,data))


    def __wait_for_lower_id_threads(self):
        for t in self.threads_list:
            if t.threadID < self.threadID :
                # print("Thread {} is waiting for Thread {}\n".format(self.threadID,t.threadID))
                t.join()


    def run(self):
        # print ("Starting " + self.name)
        global result
        res =""
        cur_num = 0
        for i in range(math.floor(len(data) / 8)):
            temp = self.data[cur_num: cur_num + 8]
            cur_num += 8
            res = res + temp[6:8] + temp[4:6] + temp[2:4] + temp[0:2]

        # print("Thread id {} prints: \n {}".format(self.threadID,res))
        self.__wait_for_lower_id_threads()
        result += res









def multithreading_implementation(num_of_threads):
    threads = []
    curr_pos_in_string =0;
    chunk_size = math.floor(len(data) / num_of_threads)
    for index in range(num_of_threads):
        thr = myThread(index, "Thread- " +str(index), data[curr_pos_in_string : curr_pos_in_string + chunk_size] , threads )
        threads.append(thr)
        curr_pos_in_string += chunk_size

    for t in threads:
        t.start()

    for t in threads:
        t.join()

    return result





